import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";
import Projet from "./Projet";
import '../Realisations.css';


const Realisations = () => {
    const projets = [
        {
            titre: "Projet 1: Site vitrine pour la boutique Iss09 (Informatique, Services, Saverdun) ",
            description: "Le site http://iss09.fr est un site vitrine que j'ai développé en distanciel avant mon entrée en formation à l'ADRAR. J'ai utilisé les technologies suivantes : HTML, CSS, JavaScript et PHP. Ce site est destiné à présenter l'entreprise ISS09, qui propose des services en installation de système de sécurité, dépannage informatique et formation. Si vous voulez voir le site en ligne, vous pouvez cliquer sur le lien ON-LINE dans la description du projet sur mon portfolio.",
            imageSrc: "../chemin/vers/image1.png",
        },
        {
            titre: "Projet 2",
            description: "Description du projet2",
            imageSrc: "../chemin/vers/image2.png",
        },
        {
            titre: "Projet 3",
            description: "Description du projet 3",
            imageSrc: "../chemin/vers/image3.png",
        },
    ];

    return (
        <div>
            <section id="#Realisations">
                <Navbar />
                <h3>Découvrez mes projets réalisés, qui mettent en avant mon expertise en matière de développement web.</h3>

                <Footer />
            </section>
            <h2>Réalisations</h2>
            {projets.map((projet) => (
                <Projet

                    titre={projet.titre}
                    description={projet.description}
                    imageSrc={projet.imageSrc}
                />
            ))}
        </div>
    );
};

export default Realisations;
